import React, { useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { useAuth } from '../contexts/AuthContext';
import {
  Container,
  Box,
  Typography,
  Button,
  Paper,
  useTheme,
  Grid,
  Fade,
  Zoom,
  Slide,
  alpha,
} from '@mui/material';
import GoogleIcon from '@mui/icons-material/Google';
import CampaignIcon from '@mui/icons-material/Campaign';
import SecurityIcon from '@mui/icons-material/Security';
import SpeedIcon from '@mui/icons-material/Speed';
import AnalyticsIcon from '@mui/icons-material/Analytics';
import config from '../config';

const Login: React.FC = () => {
  const { login, isAuthenticated } = useAuth();
  const navigate = useNavigate();
  const theme = useTheme();

  useEffect(() => {
    if (isAuthenticated) {
      navigate('/');
    }
  }, [isAuthenticated, navigate]);

  const handleLogin = () => {
    window.location.href = `${config.API_URL}/api/auth/google`;
  };

  const features = [
    {
      icon: <SecurityIcon sx={{ fontSize: 40 }} />,
      title: 'Secure Authentication',
      description: 'Enterprise-grade security with Google OAuth integration'
    },
    {
      icon: <SpeedIcon sx={{ fontSize: 40 }} />,
      title: 'Fast & Efficient',
      description: 'Optimized performance for quick campaign management'
    },
    {
      icon: <AnalyticsIcon sx={{ fontSize: 40 }} />,
      title: 'Smart Analytics',
      description: 'Real-time insights and campaign performance tracking'
    }
  ];

  return (
    <Box
      sx={{
        minHeight: '100vh',
        background: `linear-gradient(135deg, ${theme.palette.primary.main} 0%, ${theme.palette.primary.dark} 100%)`,
        position: 'relative',
        overflow: 'hidden',
        '&::before': {
          content: '""',
          position: 'absolute',
          top: 0,
          left: 0,
          right: 0,
          bottom: 0,
          background: 'url("/pattern.svg")',
          opacity: 0.1,
          animation: 'slide 20s linear infinite',
        },
        '@keyframes slide': {
          '0%': { transform: 'translateX(0)' },
          '100%': { transform: 'translateX(-100%)' },
        },
      }}
    >
      <Container maxWidth="lg" sx={{ height: '100vh', py: 4 }}>
        <Grid container spacing={4} alignItems="center" sx={{ height: '100%' }}>
          <Grid item xs={12} md={6}>
            <Fade in timeout={1000}>
              <Box sx={{ color: 'white', textAlign: { xs: 'center', md: 'left' } }}>
                <Typography
                  variant="h2"
                  sx={{
                    fontWeight: 'bold',
                    mb: 2,
                    fontSize: { xs: '2.5rem', md: '3.5rem' },
                    textShadow: '2px 2px 4px rgba(0,0,0,0.2)',
                  }}
                >
                  Welcome to Mini CRM
                </Typography>
                <Typography
                  variant="h5"
                  sx={{
                    mb: 4,
                    opacity: 0.9,
                    fontSize: { xs: '1.2rem', md: '1.5rem' },
                  }}
                >
                  Your all-in-one marketing campaign management solution
                </Typography>
                <Box sx={{ display: 'flex', flexDirection: 'column', gap: 2, alignItems: { xs: 'center', md: 'flex-start' } }}>
                  {features.map((feature, index) => (
                    <Slide
                      key={feature.title}
                      direction="right"
                      in
                      timeout={1000}
                      style={{ transitionDelay: `${index * 200}ms` }}
                    >
                      <Box
                        sx={{
                          display: 'flex',
                          alignItems: 'center',
                          gap: 2,
                          p: 2,
                          borderRadius: 2,
                          background: alpha('#fff', 0.1),
                          backdropFilter: 'blur(10px)',
                          width: 'fit-content',
                        }}
                      >
                        {feature.icon}
                        <Box>
                          <Typography variant="h6" sx={{ fontWeight: 'bold' }}>
                            {feature.title}
                          </Typography>
                          <Typography variant="body2" sx={{ opacity: 0.9 }}>
                            {feature.description}
                          </Typography>
                        </Box>
                      </Box>
                    </Slide>
                  ))}
                </Box>
              </Box>
            </Fade>
          </Grid>
          <Grid item xs={12} md={6}>
            <Zoom in timeout={1000}>
              <Paper
                elevation={24}
                sx={{
                  p: 4,
                  display: 'flex',
                  flexDirection: 'column',
                  alignItems: 'center',
                  borderRadius: 4,
                  background: alpha('#fff', 0.95),
                  backdropFilter: 'blur(10px)',
                  boxShadow: '0 8px 32px rgba(0,0,0,0.1)',
                }}
              >
                <CampaignIcon
                  sx={{
                    fontSize: 80,
                    color: theme.palette.primary.main,
                    mb: 2,
                    animation: 'float 3s ease-in-out infinite',
                    '@keyframes float': {
                      '0%, 100%': { transform: 'translateY(0)' },
                      '50%': { transform: 'translateY(-10px)' },
                    },
                  }}
                />
                <Typography
                  component="h1"
                  variant="h4"
                  sx={{
                    mb: 1,
                    fontWeight: 'bold',
                    color: theme.palette.primary.main,
                    textAlign: 'center',
                  }}
                >
                  Get Started
                </Typography>
                <Typography
                  variant="subtitle1"
                  sx={{
                    mb: 4,
                    color: 'text.secondary',
                    textAlign: 'center',
                    maxWidth: '400px',
                  }}
                >
                  Sign in with your Google account to access your marketing campaigns
                </Typography>
                <Button
                  variant="contained"
                  startIcon={<GoogleIcon />}
                  onClick={handleLogin}
                  sx={{
                    mt: 2,
                    py: 1.5,
                    px: 4,
                    borderRadius: 2,
                    textTransform: 'none',
                    fontSize: '1.1rem',
                    boxShadow: 3,
                    background: '#fff',
                    color: '#757575',
                    '&:hover': {
                      boxShadow: 6,
                      background: '#f5f5f5',
                    },
                  }}
                  fullWidth
                >
                  Sign in with Google
                </Button>
                <Typography
                  variant="body2"
                  sx={{
                    mt: 4,
                    color: 'text.secondary',
                    textAlign: 'center',
                    maxWidth: '400px',
                  }}
                >
                  By signing in, you agree to our Terms of Service and Privacy Policy
                </Typography>
              </Paper>
            </Zoom>
          </Grid>
        </Grid>
      </Container>
    </Box>
  );
};

export default Login;
